import React from 'react';
import './App.css';
import Relogio from './Relogio'
import LabelCronometro from './LabelCronometro'
import {Navbar, Nav} from 'react-bootstrap';

function App() {
  return (
    <div>
		<Navbar bg="primary" variant="dark">
		<Navbar.Brand href="#home">Relógio Online</Navbar.Brand>
			<Nav className="mr-auto">
				<Nav.Link href="/">Relógio</Nav.Link>
				<Nav.Link href="/cronometro">Cronômetro</Nav.Link>
				<Nav.Link href="/timer">Temporizador</Nav.Link>
			</Nav>
		</Navbar>
		<div class='container'>
			<div class="justify-content-center d-flex mt-4">
				<LabelCronometro class="display-3" name="Horário Local"/>
				<Relogio/>
			</div>
		</div>
    </div>
  );
}

export default App;
